public class InnerPolicyPolicyOptionFactory(Action<Humidifier.FMS.PolicyTypes.PolicyOption> factoryAction = null) : SubResourceFactory<Humidifier.FMS.PolicyTypes.PolicyOption>
{

    internal InnerPolicyNetworkFirewallPolicyFactory NetworkFirewallPolicyFactory { get; set; }

    internal InnerPolicyNetworkAclCommonPolicyFactory NetworkAclCommonPolicyFactory { get; set; }

    internal InnerPolicyThirdPartyFirewallPolicyFactory ThirdPartyFirewallPolicyFactory { get; set; }

    protected override Humidifier.FMS.PolicyTypes.PolicyOption Create()
    {
        var policyOptionResult = CreatePolicyOption();
        factoryAction?.Invoke(policyOptionResult);

        return policyOptionResult;
    }

    private Humidifier.FMS.PolicyTypes.PolicyOption CreatePolicyOption()
    {
        var policyOptionResult = new Humidifier.FMS.PolicyTypes.PolicyOption();

        return policyOptionResult;
    }
    public override void CreateChildren(Humidifier.FMS.PolicyTypes.PolicyOption result)
    {
        base.CreateChildren(result);

        result.NetworkFirewallPolicy ??= NetworkFirewallPolicyFactory?.Build();
        result.NetworkAclCommonPolicy ??= NetworkAclCommonPolicyFactory?.Build();
        result.ThirdPartyFirewallPolicy ??= ThirdPartyFirewallPolicyFactory?.Build();
    }

} // End Of Class

